import { ENDED_PREVENT_SPAM, PREVENT_SPAM } from "./preventTypes";

const initialState = {
  Clicked: false,
};

const preventReducer = (state = initialState, action) => {
  switch (action.type) {
    case CLICK:
      return {
        ...state,
        Clicked: true,
      };
    case ENDED_PREVENT_SPAM:
      return {
        ...state,
        Clicked: false,
      };

    default:
      return state;
  }
};

export default preventReducer;
